// src/App.js
import React, { useState } from 'react';
import './App.css';

function App() {
  const [email, setEmail] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Email submitted:', email);
    // Optionally call your Flask endpoint here
  };

  return (
    <div className="App">
      {/* Hero Section */}
      <section className="hero">
        <h1>Seamless Intake, Instant Insights</h1>
        <p>
          Our AI-powered platform streamlines custom intake forms and delivers 
          comprehensive summaries.
        </p>
        <form className="form-inline" onSubmit={handleSubmit}>
          <input
            type="email"
            placeholder="name@email.com"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
          <button type="submit">Get Notified</button>
        </form>
      </section>

      {/* Features Section */}
      <section className="features">
        <h2>Explore Our Dashboards</h2>
        <div className="feature-items">
          <div className="feature-item">
            <img 
              src="/assets/PUja2jlMhB77g7YskLJxlVzkBAA.jpg"
              alt="Vital Workflow"
            />
            <h3>Vital Workflow</h3>
            <p>Monitor vital data in real-time.</p>
          </div>
          <div className="feature-item">
            <img 
              src="/assets/9TKZna4TfSaouPHKZ1nNGn5s4.jpg"
              alt="Crypto Dash"
            />
            <h3>Crypto Dash</h3>
            <p>Track digital assets and analytics.</p>
          </div>
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>Â© 2025 Atomic. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
